eta\",\"answeredCorrectly\":\"Respondido incorretamente\",\"answeredIncorrectly\":\"Respondido corretamente\",\"solutionLabel\":\"Espaço em branco @num de @total\",\"inputLabel\":\"Resposta aberta @num de um total de @total\",\"inputHasTipLabel\":\"Dica disponível\",\"tipLabel\":\"Dica\",\"behaviour\":{\"enableRetry\":true,\"enableSolutionsButton\":true,\"enableCheckButton\":true,\"autoCheck\":false,\"caseSensitive\":true,\"showSolutionsRequiresInput\":true,\"separateLines\":false,\"confirmCheckDialog\":false,\"confirmRetryDialog\":false,\"acceptSpellingErrors\":false},\"scoreBarLabel\":\"Conseguiu :num pontos de um total de :total\",\"a11yCheck\":\"Mostrar a solução. A atividade será marcada com a respetiva solução correta.\",\"a11yShowSolution\":\"Mostrar a solução. A tarefa será marcada com a sua solução correta.\",\"a11yRetry\":\"Tente de novo. Apagar todas as respostas e iniciar de novo.\",\"a11yCheckingModeHeader\":\"Modo de verificação\",\"confirmCheck\":{\"header\":\"Tentar novamente?\",\"body\":\"Tem a certeza de que pretende tentar novamente?\",\"cancelLabel\":\"Cancelar\",\"confirmLabel\":\"Terminar\"},\"confirmRetry\":{\"header\":\"Repetir ?\",\"body\":\"Tem a certeza que deseja repetir?\",\"cancelLabel\":\"Cancelar\",\"confirmLabel\":\"Confirmar\"},\"questions\":[\"<p>A *bandeira* do Mali possui *três* cores, que são o *verde*, amarelo e *vermelho/encarnado*.</p>\\n\\n<p>A bandeira da Polónia é diferente da bandeira do *Mónaco* porque, apesar de as cores estarem dispostas *horizontalmente:similar a deitado*, a cor superior é *branca* e a inferior é *vermelha/encarnada:cor do sangue* exatamente o contrário da bandeira do *Mónaco*.</p>\\n\\n<p>As bandeiras da Guiné e do *Mali* têm as cores dispostas na vertical. Há uma cor que está na mesma posição em ambas as bandeiras, que é a cor *amarela*.</p>\\n\"]},\"metadata\":{\"embedTypes\":[\"iframe\"],\"language\":\"en\",\"defaultLanguage\":\"pt\",\"license\":\"U\",\"extraTitle\":\"Bandeiras\",\"title\":\"Bande
